// SPDX-License-Identifier: GPL-3.0
pragma solidity >=0.7.0 <0.9.0;
import "./tokeniz.sol";
contract proxy{
    Tokeniz public tokeniz;

    function newTokeniz(address _initiator,string memory tokenName, string memory _tokenURI, address[] memory _tokensAddresses, uint[] memory _amounts,uint256 _tracker) public returns (address ) {
        tokeniz = new Tokeniz(_initiator, tokenName, _tokenURI,  _tokensAddresses, _amounts,_tracker );
        return address(tokeniz);
    }
}

tron/tokeniz.sol.content:
// SPDX-License-Identifier: GPL-3.0

pragma solidity >=0.7.0 <0.9.0;

interface IERC20 {
    function transfer(address _to, uint256 _amount) external returns (bool);
}

contract Tokeniz{
    address private TokenizAdmin;
    address public owner;
    bool public packed;
    string public tokenURI;
    string public name;
    mapping(address => uint) public tokenBalance;
    address[] public tokensAddresses;
    uint256 public tokenId;
    
    /**
     * @dev Create a new Tokeniz to choose one of.
     */
    constructor(address _initiator, string memory _name, string memory _tokenURI, address[] memory _tokensAddresses, uint[] memory _amounts, uint256 _tokenID) {
        TokenizAdmin = msg.sender;
        owner = _initiator; 
        packed = true;
        for (uint i = 0; i < _tokensAddresses.length; i++) {
            tokensAddresses.push(_tokensAddresses[i]);
            tokenBalance[_tokensAddresses[i]]=_amounts[i];
        }
        tokenURI=_tokenURI;
        name= _name;
        tokenId= _tokenID;
    }
    function isPacked() public view returns(bool){
        return packed;
    }
    
    function unPack() public{
        require(
            msg.sender== owner,
            "Only Owner can unpack Tokeniz."
            );
        require(packed, "Already unpacked Tokeniz");
        payable(owner).transfer(address(this).balance);
        for (uint i = 0; i < tokensAddresses.length; i++) {
            address _tokenContracts= tokensAddresses[i];
            IERC20 tokenContract = IERC20(_tokenContracts);
            tokenContract.transfer(owner, tokenBalance[_tokenContracts]);
        }
        packed= false;
    }
    
    function _safeUnPack() internal{
        require(msg.sender == TokenizAdmin, "Must be sent via Tokeniz admin contract");
        require(packed, "Already unpacked Tokeniz");
        payable(owner).transfer(address(this).balance);
        for (uint i = 0; i < tokensAddresses.length; i++) {
            address _tokenContracts= tokensAddresses[i];
            IERC20 tokenContract = IERC20(_tokenContracts);
            tokenContract.transfer(owner, tokenBalance[_tokenContracts]);
        }
        packed= false;
    }
    
    function _safeTransfer(address _initiator,address receiver) internal{
        require(owner== _initiator,"Only owner can transfer");
        require(msg.sender == TokenizAdmin, "Must be sent via Tokeniz admin contract");
        owner= receiver;
    }
}

